import React, { Component } from "react";
import axios from "axios";
class CentersTest extends Component {
  state = {
    centers: [],
  };
  async componentDidMount() {
    const { data: centers } = await axios.get(
      "https://localhost:44303/api/centers"
    );
    this.setState({ centers });
  }
  render() {
    return (
      <React.Fragment>
        <h1>My profile:</h1>
        {this.state.centers.map((center) => (
          <li key={center.id}>{center.name}</li>
        ))}
      </React.Fragment>
    );
  }
}

export default CentersTest;
